import "../styles/Home.css";

const Home = () => {
  return (
    <div className="main-container">
      <div className="home-text">
        <h1 className="display-1">Pablo Asenjo</h1>
        <h3 className="display-3">Desarrollador Full-Stack</h3>
      </div>
      <div className="home-img">
        <img src={require("../img/photo.jpeg")} />
      </div>
    </div>
  );
};

export default Home;
